import React, { Component } from 'react';

class GetItems extends Component {
  constructor(props){
    super(props);

    this.state = {
      reload: Boolean,
      items: []
    }
  }

  getItemsGET(){
    fetch('http://localhost:3000/api/item/all')
      .then(response => response.json())
      .then(data => {
        this.setState({items: data});
